import React, { useState } from 'react';
import './App.css';

// Simple form component for testing
const PredictionForm = ({ onSubmit }) => {
  const [formData, setFormData] = useState({
    writing_score: '',
    reading_score: ''
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    onSubmit(formData);
  };

  return (
    <form onSubmit={handleSubmit}>
      <h2>Test Prediction</h2>
      <div>
        <label>Writing Score:</label>
        <input
          type="number"
          name="writing_score"
          value={formData.writing_score}
          onChange={handleChange}
        />
      </div>
      <div>
        <label>Reading Score:</label>
        <input
          type="number"
          name="reading_score"
          value={formData.reading_score}
          onChange={handleChange}
        />
      </div>
      <button type="submit">Predict</button>
    </form>
  );
};

function App() {
  const [prediction, setPrediction] = useState(null);
  const [loading, setLoading] = useState(false);

  const handlePrediction = async (formData) => {
    setLoading(true);
    
    // Simulate API call with timeout
    setTimeout(() => {
      const writing = parseFloat(formData.writing_score);
      const reading = parseFloat(formData.reading_score);
      const mockPrediction = Math.floor((writing + reading) / 2 * 0.9);
      setPrediction(mockPrediction);
      setLoading(false);
    }, 1000);
  };

  return (
    <div className="App">
      <h1>Student Performance Predictor</h1>
      <PredictionForm onSubmit={handlePrediction} />
      
      {loading && <p>Loading...</p>}
      
      {prediction !== null && (
        <div>
          <h2>Prediction Result</h2>
          <p>Predicted Math Score: {prediction}</p>
        </div>
      )}
    </div>
  );
}

export default App;
